        <Header>Sydney lockdown extended with more restrictions</Header>
        <Content>
          <img src='https://image.shutterstock.com/image-vector/breaking-news-world-map-backgorund-260nw-640991758.jpg' alt='detail'/>
        </Content>
      </DetailWrapper>
    );
  }
}

export default Detail;
